import React from 'react';
import { Button, Flex } from 'antd';

type ButtonProps = {
    label: string;
    type?: 'primary' | 'secondary' | 'dashed' | 'text'| 'link';

}

export const CButton: React.FC<ButtonProps> = ({type='primary', label})=> {
    return <Button type={type}>{label}</Button>

}
